import React from "react";
import { useDrag } from "react-dnd";
import Avatar from "@mui/material/Avatar";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";

function Employee({ employee: employee }) {
  const [{ isDragging }, drag] = useDrag(() => ({
    type: "employee",
    item: { employee: employee },

    collect: (monitor) => ({
      isDragging: !!monitor.isDragging(),
    }),
  }));
  const style = {
    backgroundColor: "rgba(255, 255, 255, 0.3)",
    borderRadius: "20px",
  };
  const swiper = new Swiper(".swiper-container", {
    loop: true,
    lazy: {
      loadPrevNext: true,
    },
    pagination: {
      el: ".swiper-pagination",
      clickable: true,
    },
    navigation: {
      nextEl: ".swiper-button-next",
      prevEl: ".swiper-button-prev",
    },
  });

  return (
    <div class="swiper-container">
      <div class="swiper-wrapper">
        <div class="swiper-slide">
          <img
            data-src="https://picsum.photos/id/81/200"
            class="swiper-lazy"
          ></img>
          <div class="swiper-lazy-preloader"></div>
        </div>
        <div class="swiper-slide">
          <img
            data-src="https://picsum.photos/id/82/200"
            class="swiper-lazy"
          ></img>
          <div class="swiper-lazy-preloader"></div>
        </div>
        <div class="swiper-slide">
          <img
            data-src="https://picsum.photos/id/83/200"
            class="swiper-lazy"
          ></img>
          <div class="swiper-lazy-preloader"></div>
        </div>
        <div class="swiper-slide">
          <img
            data-src="https://picsum.photos/id/84/200"
            class="swiper-lazy"
          ></img>
          <div class="swiper-lazy-preloader"></div>
        </div>
        <div class="swiper-slide">
          <img
            data-src="https://picsum.photos/id/95/200"
            class="swiper-lazy"
          ></img>
          <div class="swiper-lazy-preloader"></div>
        </div>
      </div>

      <div class="swiper-pagination"></div>

      <div class="swiper-button-next"></div>
      <div class="swiper-button-prev"></div>
    </div>
  );
}

export default Employee;
